import { Logo } from './Logo';
import LoginForm from './components/LoginForm';
import Form from './pages/form';

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Box fontSize="xl" justify='center' align='center' mt="20vh">
        {/* <Form></Form> */}
        <LoginForm></LoginForm>
      </Box>
    </ChakraProvider>
  );
}

export default App;
